export const Total = ({ course }) => {
  return course.map((content) => {
    const parts = content.parts;
    const total = parts.reduce((total, ex) => total + ex.exercises, 0);
    return (
      <p key={content.id}>
        <b>Total of {total} exercises</b>
      </p>
    );
  });
};
